package util;

import java.text.SimpleDateFormat;
import java.util.List;

import main.SetValue;
import bean.Data;

public class test {
	private static SimpleDateFormat format = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
	public static void main(String[] args) {
		SetValue value=new SetValue("");
		List<Data> datas =  value.getDatas();
		for(int i=0;i<datas.size();i++){
			System.out.println("第"+i+"个时间："+format.format(datas.get(i).getDate()));
			System.out.println("第"+i+"个值名称："+datas.get(i).getName());
			System.out.println("第"+i+"个值类型："+datas.get(i).getValuetype());
			System.out.println("第"+i+"个值："+datas.get(i).getValue());
		}
	}
}
